import React from 'react';

const VideoItem = ({video}) => {
    console.log(video)
    const thumbnail = video.snippet.thumbnails.default.url
    const altDes = video.snippet.description;
    return (
        <div>
            <div class="item">
                <div class="content">
                    <div class="header">
                        <img alt={altDes} src={thumbnail} />
                        {video.snippet.title}
                    </div>
                </div>
            </div>

        </div>
    )
}

export default VideoItem;
